import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {BrowserRouter , Routes, Route } from "react-router-dom";
import Home from './Guest_Page';
import Registering from './Registering-page';
import MainPage from './Main_User_Page';
import SearchResults from './results_page';
import Product from './ProductPage';
import CartPage from './Cart';
import ProductList from './ProductList';
import ProductList2 from './Banners';

const App = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    // Make a GET request to the backend
    axios.get('http://localhost:5000') // Replace with your backend endpoint
      .then(response => {
        setData(response.data); // Save the response data in state
        console.log('Backend response:', response.data);
      })
      .catch(error => {
        console.error('Error connecting to backend:', error.message);
      });
  }, []);


    return(
        <BrowserRouter>
            <Routes>
                <Route path = "/" element={<Home />} />
                <Route path = "/test" element={<ProductList2 />} />

                <Route path ="/CartPage" element={<CartPage/>}/>
                <Route path="/Login" element={<Registering.LoginForm />} />
                <Route path="/SignUp" element={<Registering.SignUp />} />
                <Route path="/MainUser" element={<MainPage/>}/>
                <Route path="/Search" element={<SearchResults />} />
                <Route path="/Product" element={<Product />} />
                <Route path="/test" element= { <ProductList/>}/>
            </Routes>
        </BrowserRouter>
    );
}



export default App;
